formValues.json:
{ 
   "@pushTo:messages:1": {
      "@comment": "this pushes a new message to messages",
      "role": "system",
      "content": "you're a helpful assistant"
    },
    "@map": {
      "@comment": "this maps input.messages to messages",
      "input": "chat",
      "property": "messages",
      "map": {
        "type": "object",
        "properties": {
          "@set:role": "role",
          "@if:message": {
            "@set:content": "message"
          },
          "@if:function_call": {
            "@set:tool_calls" : "function_call"
          },
          "@if:tool_call_id": {
            "@set:tool_call_id" : "tool_call_id"
          }
        }
      }
    },
    "@if:input" : {  
      "@pushTo:messages:2": {
        "@comment": "this pushes a new message to messages",
        "role": "user",
        "@set:content": "input"
      }
    },
    "temperature": 0.6,
    "model": "gpt-4-turbo",

    "stream": true,
    "tools": [
    {
      "type": "function",
      "function": {
        "name": "get_current_weather",
        "description": "Get the current weather in a given location",
        "parameters": {
          "type": "object",
          "properties": {
            "location": {
              "type": "string",
              "description": "The city and state or country, e.g. San Francisco, CA .. another example is The Netherlands"
            },
            "unit": {
              "type": "string",
              "enum": ["celsius", "fahrenheit"]
            }
          },
          "required": ["location"]
        }
      }
    }
  ],
  "tool_choice": "auto"
}

formValues.customFunctionCode:
(a) => {
  return a.tool_calls !== undefined && 
    a.tool_calls[0].type && 
    a.tool_calls[0].function && 
    a.tool_calls[0].function.name;
};

(a) => {
  const result = a != "" &&
      typeof a == "string" &&
      typeof a != "number" &&
      a == "get_current_weather" &&
      a != undefined && 
      a != null;   
   return result;
};
